<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ライト・照明&nbsp;&gt;&nbsp;照明 オフィス

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【wasser15】wasser LEDクリップライト<br>
<br>
机を広く使える、スタンド/クリップ兼用LEDライト。<br>
タッチボタンで3段階調光が可能。<br>
フレキシブルアームとチルト構造のセード_で自由自在な角度調整。<br>
家庭用コンセントに、本体に付属しているコードを差し込むだけで設置簡単。<br>
LEDライトなので省電力で長寿命とってもエコに節電対策！<br>
学習机や読書、オフィスにもピッタリ。<br>
電気代を気にせずに長時間使えるクリップライトです。<br>
<br>
【特徴】<br>
・ホワイトのさわやかなカラー<br>
・スタンド/クリップ兼用のデスクライト<br>
・軽く触れるだけでON/OFF/調_光が出来るタッチボタン。<br>
・タッチボタンで3段階調光。<br>
・チルト構造＋フレキシブルアームで自由自在な角度調整可能。<br>
・省エネ、長寿命なLED使用。<br>
・独自デザインのLEDで目に優しい。<br>
・消費電力は最大約4W。<br>
<br>
スタンドとクリップの2WAY対応LED卓上ライト。ベースとクリップは簡単に付け替えが出来る仕様。<br>
3段階の明るさでお好みの明るさを調節していただけます。<br>
角丸デザインがやさしい雰囲気を出しているのでお子さまのお部屋やリビング等にもピッタリ。<br>
白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
セードはチルト構造、フレキシブルアームで角度調整が自由自在！<br>
場所を選ばない自由度の高さが嬉しいLEDライトです。<br>
<br>
重さは約310gなので持ち運びも簡単です。<br>
<br>
<b>安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！</b><br>
<br>
規格<br>
サイズ：<br>
本体/最大約H590×W80×D155mm<br>
ベース/約H145×W25×D125mm<br>
<br>
