メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
セードは250°回転します。<br>
家庭用コンセントに、本体に付属しているコードを差し込むだけで設置簡単、<br>
LEDライトなので省電力で長寿命とってもエコ！<br>
電気代を気にせずに長時間使えます。<br>
<br>
【特徴】<br>
・自然な光を作るLED最新技術「面光源」。<br>
・チルト構造<br>
・ヒンジ２カ所＋セードで角度調整可能、「180°×250°×210°」で自由自在。<br>
・明るさは5段階の調光が可能。<br>
・軽く触れるだけでON/OFF/調光が出来るタッチセンサー。<br>
・省エネ、長寿命なLEDチップ使用。<br>
・消費電力は最大約10W。<br>
・高演性LED採用。<br>
<br>
5段階調光が可能なLED卓上ライト。<br>
光源にはLEDライトの最新技術、面光源を採用！<br>
従来のLEDライトの直接的な光と違い、<br>
複数の特殊な2枚の板と3枚のフィルムを組み合わせた構造でLEDチップの光を反射させ、<br>
広範囲を自然に照らすので、さらに目に優しく疲れにくい光になっています。<br>
また、光を均一化することによって、物に光を当てた際に多重影になりにくく、<br>
チラつき等によって起こされる目の疲れを軽減。<br>
一般的なLEDライトを超える「高演性LED」で、太陽に近い自然な光(演色指数80以上)を実現しているので、<br>
自然な光は長時間ライトを使うビジネスシーンだけでなく、<br>
お子さまのお部屋等でも安心してお使いいただけます。<br>
白熱灯や蛍光灯と比べて低発熱で、紫外線や遠赤外線が少ないという特性があり、<br>
室内温度への影響や、照射面での火傷のリスクがほとんどない安心仕様。<br>
物の劣化焼け等も軽減され、虫もよりにくくなっています。<br>
<br>
さらにwasser07は、土台やヒンジ部分だけでなく、セード部分がなんと250°回転するチルト構造。<br>
ベースやネックの角度はそのまま、ライトが当たる範囲のみを設定できます。<br>
場所を選ばない自由度の高い角度調整が可能なLEDライトです。<br>
<br>
大きすぎないのにちょうど良い存在感のあるサイズ。<br>
重さは約1.3kgなので持ち運びも簡単です。<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！<br>
<br>

