メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【wasser20】wasser 電球式卓上ライト<br>
<br>
永遠の定番。電球式デスクライト登場。<br>
LED電球も白熱電球でも使えます。<br>
ボディはシンプルでどんなお部屋にも合うホワイトカラー。<br>
やわらかなフレキシブルアームでセードを好きな角度へ調整。<br>
操作はON/OFFができるボタンをカチッと押すだけです。<br>
シンプルな操作方法で電球のあたたかみを感じることができるそんなデスクライト。<br>
wasserシリーズは進化をしながらも古き良き時代のロングセラーを尊重し復刻させました。<br>
<br>
【特徴】<br>
・シンプルだけど存在感がある。穏やかな波型デザインのシルエット。<br>
・フレキシブルアームで自由自在な角度調整可能。<br>
・LED電球・白熱電球に対応<br>
・ON/OFFはボタンを押すだけで簡単<br>
・電球が切れても付け替えるだけで繰り返し使えます<br>
<br>
安心設計＆安心価格＆安心保障（１年保証）３つの安心を約束！<br>
<br>
カラー：ホワイト<br>
<br>
規格<br>
サイズ：本体:約H370×W172×D172mm<br>
重さ：約920g<br>
電源：AC100V-240V 50Hz/60Hz <br>
対応口金：E26口金<br>
電球形状：外径φ60mm以下<br>
消費電力：電球により変動<br>
素材：ABS<br>
