<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;新生活特集

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
【wasser21】wasser LED卓上ライト<br>
<br>
電球色も昼白色も自在に調光。次世代LEDスタンド。<br>
一見、どこにでもあるデスクライト。<br>
そのミニマムなボディーにはLEDの最新技術や特許機能を搭載。<br>
調光はもちろんの事、電球色（オレンジ色）・昼白色（自然色）・白昼色（白色）の色温度も自在に変える事ができるので、<br>
用途に合わせて心地よい環境を作ってくれます。<br>
ボディはシンプルでどんなお部屋にも合うホワイトカラー。<br>
やわらかなフレキシブルアームでセードを好きな角度へ調整。<br>
wasserシリーズは進化をしながらも古き良き時代のシルエットを再現します。<br>
<br>
【特徴】<br>
・シンプルだけど存在感がある。穏やかな波型デザインのシルエット。<br>
・フレキシブルアームで自由自在な角度調整可能。<br>
・調光や電球色（オレンジ色）・昼白色（自然色）・白昼色（白色）の色温度調色も自由自在<br>
・フラットなタッチセンサー<br>
・消費電力最大約6Wでエコ<br>
・重さは約865gと軽量<br>
<br>
<b>安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！</b><br>
<br>
カラー：ホワイト<br>
<br>
規格<br>
サイズ：本体:約H370×W172×D172mm<br>
重さ：約865g<br>
電源：AC100V-240V 50Hz/60Hz <br>
調光：無段階<br>
光色：3パターン（電球色/昼白色/昼光色）<br>
明るさ：最大約1200Lux(高さ30cmから照射した場合)<br>
消費電力：最大約6W <br>
素材：ABS<br>
