<td class="sdtext">カテゴリトップ&nbsp;&gt;&nbsp;ブランドで選ぶ&nbsp;&gt;&nbsp;LED照明&nbsp;&gt;&nbsp;Wasser ヴァッサ ledライト

メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
wasser22 LEDデスクライト <br>
<br>
電球色も昼白色も自在に調光。次世代LEDスタンドライト。<br>
調光はもちろんの事、電球色（オレンジ色）・昼白色（自然色）・白昼色（白色）の色温度も自在に変える事ができるので、<br>
用途に合わせて心地よい環境を作ってくれます。<br>
やわらかなフレキシブルアームでセードを好きな角度へ調整。<br>
アルミヘアライン加工がアクセントになり、華やかに<br>
電源周りは常夜灯。消灯中もブルーライトが点灯しているので<br>
夜にLEDライトをONにしたいときに便利。<br>
<br>
【特徴】<br>
・シンプルだけど存在感のあるデザイン<br>
・フレキシブルアームで自由自在な角度調整可能。<br>
・調光や電球色（オレンジ色）・昼白色（自然色）・白昼色（白色）の色温度調色も自由自在<br>
・タッチセンサーで無段階調光<br>
・消費電力最大約6Wでエコ<br>
・重さは約865gと軽量<br>
<br>
<b>安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！</b><br>
<br>
カラー：ピンク/シルバー/ブラック<br>
<br>
規格<br>
サイズ：本体:約H350×W135×D182mm<br>
重さ：約865g<br>
電源：AC100V-240V 50Hz/60Hz <br>
調光：無段階<br>
光色：3パターン（電球色/昼白色/昼光色）<br>
明るさ：最大約1200Lux(高さ30cmから照射した場合)<br>
消費電力：最大約6W <br>
素材：ABS<br>
