省エネ!!長時間寿命!!やさしい低発熱!! <br>

斬新なＬＥＤ卓上デスクライト <br>

タッチパネル式操作で7段階調光 <br>


3つのポイントで自由な角度調整 <br>

簡単操作のタッチパネル <br>

しっかりした広いベース <br>

本体150°×ネック150°×ベース360°の自由度の高い角度調整が可能 <br>


タッチパネルで簡単に7段階調光 <br>

一目でわかるタッチパネル式操作で、 <br>

力を入れてボタンを押す必要なく、<br>

電源のON/OFFや、スライド長押して、<br>

場面に合わせた7段階の細かな光の加減を簡単に調整。
<br><br>

本製品の4つの特徴<br>

・スタイリッシュなセードカバー<br>

・セードをたたんで間接照明にも 自由な角度調整が可能<br>

・簡単タッチパネル操作で7段階調光<br>

84粒のＬＥＤチップを組み合わせて光を重ねることで高い照度を実現。<br>


サイズ：約H400×W200×D160mm<br>

重さ：1500g<br>

電源：AC100V　50Hz/60Hz<br>

消費電力9W<br>

コード長：約2.4m<br>

光源：LED（7段階調光）<br>

光色：白昼色<br>

光束：800Lm<br>

素材：ABS<br>

