メーカー希望小売価格はメーカーカタログに基づいて掲載しています<br>
wasser23 LEDデスクライト<br>
<br>
電球色も昼白色も自在に調光。液晶ディスプレイ搭載の次世代LEDスタンドライト。<br>
調光はもちろんの事、電球色（オレンジ色）・昼白色（自然色）・白昼色（白色）の色温度も自在に変える事ができるので、<br>
用途に合わせて心地よい環境を作ってくれます。<br>
USB出力ポート搭載でお手持ちのUSB充電コードを仕様すればスマートフォンなどに充電が可能。<br>
ディスプレイには時刻/日付を表示、バードボイスで時間を知らせるアラーム機能と、<br>
アラーム設定時間の0-2-5-10-15分前に少しずつLEDライトが点灯し、バードボイスが流れるプリアラーム機能を搭載。<br>
<br>
【特徴】<br>
・スタイリッシュなデザイン<br>
・角度調整可能。<br>
・調光や電球色（オレンジ色）・昼白色（自然色）・白昼色（白色）の色温度調色も自由自在<br>
・フラットなタッチセンサー<br>
・液晶ディスプレーで時刻/日付を表示<br>
・アラーム機能/プリアラーム機能搭載<br>
・消費電力最大約10Wでエコ<br>
・重さは約1.2kgと軽量<br>
<br>
<b>安心設計＆安心価格＆安心保障（１年保証）<br>
３つの安心を約束！</b><br>
<br>
<br>
規格<br>
サイズ：本体:約H420×W163×D204mm<br>
重さ：約1.2kg<br>
電源：AC100V-240V 50Hz/60Hz <br>
調光：無段階<br>
光色：3パターン（電球色/昼白色/昼光色）<br>
明るさ：最大約1200Lux(高さ30cmから照射した場合)<br>
消費電力：最大約10W <br>
素材：ABS/アルミ<br>
